import React from 'react';

// Sample data for the sports categories
const sports = [
  { id: 1, name: 'Badminton', image: '', link: '/badminton_products.html' }
  // Add more sports as needed
];

const SportsCategorySection = () => {
  return (
    <section id="shopSection">
      <h2 className="title text-center my-5">SHOP NOW</h2>
      <div className="row">
        {sports.map(sport => (
          <div className="col-lg-4 col-md-6 mb-4" key={sport.id}>
            <div className="card">
              <img src={sport.image} className="card-img-top custom-card-img" alt={sport.name} />
              <div className="card-body">
                <h5 className="card-title">{sport.name}</h5>
                <a href={sport.link} className="btn btn-primary">SHOP NOW</a>
              </div>
            </div>
          </div>
        ))}
      </div>
    </section>
  );
};

export default SportsCategorySection;
